styles:
.sky-datepicker-calendar-inner {
  border-radius: 5px;
  background-color: #ffffff;
  border-top: 1px solid #e2e3e4;
  border-bottom: 1px solid #e2e3e4;
  border-left: 1px solid #e2e3e4;
  border-right: 1px solid #e2e3e4;
}

.sky-datepicker-calendar-inner /deep/ .sky-btn-default {
  border-color: #ffffff;
}

.sky-datepicker-calendar-inner /deep/ .sky-btn-default:hover, .sky-datepicker-calendar-inner /deep/ .sky-btn-active {
  border-color: #c2c4c6;
}

.sky-datepicker-calendar-inner /deep/ .sky-datepicker-center {
  text-align: center;
}

.sky-datepicker-calendar-inner /deep/ .sky-datepicker-btn-selected {
  color: #ffffff;
  background-color: #007ca6;
  border-top: 1px solid #cdcfd2;
  border-bottom: 1px solid #cdcfd2;
  border-left: 1px solid #cdcfd2;
  border-right: 1px solid #cdcfd2;
}

.sky-datepicker-calendar-inner /deep/ .sky-datepicker-secondary {
  color: #686c73;
}

.sky-datepicker-calendar-inner /deep/ .sky-datepicker-btn-date {
  min-width: 100%;
}

.sky-datepicker-calendar-inner /deep/ .sky-datepicker-calendar-title {
  width: 100%;
